INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", "2025/01/31 12:00:00", 1, 62, 0.0, 2, 1, 3.414, "2030/01/01 14:59:59", 1000001, 1, -416.5, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "ミッションをクリアして、\n報酬をゲットしましょう！", "2025/01/31 12:00:00", 2, 62, 0.0, 2, 1, 3.099, "2030/01/01 14:59:59", 1000002, 1, -416.5, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "受け取ることができる\n報酬があるようです\n確認してみてください", "2025/01/31 12:00:00", 3, 63, 0.0, 2, 1, 2.801, "2030/01/01 14:59:59", 1000003, 1, -416.5, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "報酬がもらえますよ！\nチェックしてみてください", "2025/01/31 12:00:00", 4, 63, 0.0, 2, 2, 0.0, "2030/01/01 14:59:59", 1000004, 1, -416.5, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2025/01/31 12:00:00", 5, 64, 0.0, 1, 2, 2.12, "2030/01/01 14:59:59", 1000005, 1, -363.0, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "2025/01/31 12:00:00", 6, 64, 0.0, 2, 1, 1.68, "2030/01/01 14:59:59", 1000006, 1, -363.0, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (190801, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2025/01/31 12:00:00", 7, 64, 0.0, 1, 2, 2.33, "2030/01/01 14:59:59", 1000007, 1, -363.0, "カリン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (133701, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2025/01/31 12:00:00", 101, 61, -6.0, 7, 3, 5.18, "2030/01/01 14:59:59", 1020101, 10201, -285.0, "ラビリスタ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (133901, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2025/01/31 12:00:00", 201, 61, -2.0, 2, 1, 8.77, "2030/01/01 14:59:59", 1020102, 10201, -285.0, "クリスティーナ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (133801, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2025/01/31 12:00:00", 301, 61, 0.0, 1, 6, 15.5, "2030/01/01 14:59:59", 1020103, 10201, -285.0, "ネネカ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (134301, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2025/02/28 12:00:00", 101, 61, 0.0, 5, 2, 9.061, "2030/01/01 14:59:59", 1020201, 10202, -285.0, "ランファ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (134401, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2025/02/28 12:00:00", 201, 61, 0.0, 2, 1, 7.699, "2030/01/01 14:59:59", 1020202, 10202, -285.0, "チカ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (134601, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2025/03/31 12:00:00", 101, 61, 0.0, 2, 1, 8.595, "2030/01/01 14:59:59", 1020301, 10203, -285.0, "アオイ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (134501, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2025/03/31 12:00:00", 201, 61, 0.0, 2, 1, 7.758, "2030/01/01 14:59:59", 1020302, 10203, -285.0, "クローチェ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (132302, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2025/04/30 12:00:00", 101, 61, 0.0, 6, 2, 7.0, "2030/01/01 14:59:59", 1020401, 10204, -285.0, "ルイズマリー");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (132402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2025/04/30 12:00:00", 201, 61, 0.0, 2, 1, 7.904, "2030/01/01 14:59:59", 1020402, 10204, -285.0, "イロハ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (132502, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2025/04/30 12:00:00", 301, 61, 0.0, 2, 4, 8.487, "2030/01/01 14:59:59", 1020403, 10204, -285.0, "ソノ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (134901, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2025/05/31 12:00:00", 101, 61, 0.0, 2, 1, 8.763, "2030/01/01 14:59:59", 1020502, 10205, -285.0, "カノン");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (134801, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2025/05/31 12:00:00", 201, 61, 0.0, 3, 1, 6.417, "2030/01/01 14:59:59", 1020503, 10205, -285.0, "ツムギ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135001, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "2025/06/30 12:00:00", 101, 61, 0.0, 7, 3, 10.335, "2030/01/01 14:59:59", 1020601, 10206, -285.0, "エリス");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135101, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "2025/06/30 12:00:00", 201, 61, 0.0, 4, 2, 6.281, "2030/01/01 14:59:59", 1020602, 10206, -285.0, "シェフィ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135201, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "2025/06/30 12:00:00", 301, 61, 0.0, 2, 1, 12.244, "2030/01/01 14:59:59", 1020603, 10206, -285.0, "プレシア");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135301, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "2025/07/31 12:00:00", 101, 61, 0.0, 8, 2, 6.339, "2030/01/01 14:59:59", 1020701, 10207, -285.0, "クリア");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135401, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "2025/07/31 12:00:00", 201, 61, 0.0, 9, 7, 8.184, "2030/01/01 14:59:59", 1020702, 10207, -285.0, "アネモネ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (129101, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", "2025/08/31 12:00:00", 101, 61, 0.0, 2, 9, 3.906, "2030/01/01 14:59:59", 1020801, 10208, -285.0, "アイラ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (129201, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", "2025/08/31 12:00:00", 201, 61, 0.0, 2, 1, 14.465, "2030/01/01 14:59:59", 1020802, 10208, -285.0, "シナツ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (100101, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", "2025/08/31 12:00:00", 301, 61, 0.0, 3, 4, 8.662, "2030/01/01 14:59:59", 1020803, 10208, -285.0, "ヒヨリ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (100301, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", "2025/08/31 12:00:00", 401, 61, 0.0, 3, 1, 10.915, "2030/01/01 14:59:59", 1020804, 10208, -285.0, "レイ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135802, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", "2025/09/30 12:00:00", 101, 61, 0.0, 7, 1, 6.042, "2030/01/01 14:59:59", 1020901, 10209, -285.0, "ユキノ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (135903, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", "2025/09/30 12:00:00", 201, 61, 0.0, 1, 4, 9.402, "2030/01/01 14:59:59", 1020902, 10209, -285.0, "サツキ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (136902, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", "2025/09/30 12:00:00", 301, 61, 0.0, 1, 8, 8.16, "2030/01/01 14:59:59", 1020903, 10209, -285.0, "ルルィ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (137401, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", "2025/10/31 12:00:00", 101, 61, 0.0, 2, 3, 5.0, "2030/01/01 14:59:59", 1021001, 10210, -285.0, "カスミ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (136001, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", "2025/10/31 12:00:00", 201, 61, 0.0, 1, 4, 8.12, "2030/01/01 14:59:59", 1021002, 10210, -285.0, "アラクネ");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (136202, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", "2025/10/31 12:00:00", 301, 61, 0.0, 2, 4, 6.386, "2030/01/01 14:59:59", 1021003, 10210, -285.0, "ナーナ");
